import React from 'react';
import { Box, Text, Center, ChakraProvider } from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Center h="100vh">
        <Box textAlign="center" p={5}>
          <Text fontSize="2xl">Library Management System</Text>
          <Text>Welcome to the Library Application</Text>
        </Box>
      </Center>
    </ChakraProvider>
  );
}

export default App;
